import React from "react";
import "./tasks-filter.css";

const TasksFilter = ({butEl, allTodo}) => {
    return (
        <li key={butEl.id }>
            <button onClick={allTodo} className={butEl.className}>{butEl.text}</button>
        </li>
    );
}

export default TasksFilter;
